import React, { useState } from "react";
// import {
//   HashRouter as Router,
//   Switch,
//   Route,
//   Routes,
//   Link,
//   Redirect,
// } from "react-router-dom";
import { BrowserRouter, Routes, Route, Navigate } from "react-router-dom";
import { useEffect } from "react";

import logo from "./logo.svg";
import "./App.css";
import NavBar from "./components/navBar";
import HomePage from "./components/homePage";
import GameDetails from "./components/gameDetails";
import PlayGame from "./components/playGame";
import AboutPage from "./components/aboutPage";
import SubjectsPage from "./components/subjectsPage";
import SearchPage from "./components/searchPage";
import Login from "./components/login";
import SignUp from "./components/signup";
import UserHome from "./components/user/userHome";
import PastProblems from "./components/user/pastProblems";
import SubjectTopics from "./components/user/subjectTopics";
import UserComments from "./components/user/userComments";
import AddStory from "./components/user/addStory";
import GameHistory from "./components/user/gameHistory";
import UserSettings from "./components/user/userSettings";
import TopicsPage from "./components/topicsPage";

import IsLoggedIn from "./components/utilities/loginStatus";

function App() {
  return (
    <div className="App">
      <React.StrictMode>
        <BrowserRouter>
          <NavBar />
          <Routes>
            <Route exact path="/" element={<HomePage />} />
            <Route exact path="/games/:id" element={<GameDetails />} />
            <Route path="/games/:id/play" element={<PlayGame />} />
            <Route path="/about" element={<AboutPage />} />
            <Route path="/subjects" element={<SubjectsPage />} />
            <Route path="/search/:query" element={<SearchPage />} />
            <Route path="/search/" element={<SearchPage />} />
            {IsLoggedIn() && (
              <>
                <Route path="/login" element={<Navigate to="/user" />} />
                <Route path="/signup" element={<Navigate to="/user" />} />
              </>
            )}
            {!IsLoggedIn() && (
              <>
                <Route exact path="/user" element={<Navigate to="/login" />} />
                <Route path="/user" element={<Navigate to="/login/" />} />
                {/* <Route
                path="/user/past-problems"
                element={<Navigate to="/login" />}
              />
              <Route
                path="/user/subject-topics"
                element={<Navigate to="/login" />}
              />
              <Route path="/user/settings" element={<Navigate to="/login" />} /> */}
              </>
            )}
            <Route path="/login" element={<Login />} />
            <Route path="/signup" element={<SignUp />} />
            {/* users */}
            <Route path="/user" element={<UserHome />} />
            <Route path="/user/past-problems" element={<PastProblems />} />
            <Route path="/user/subject-topics" element={<SubjectTopics />} />
            <Route path="/user/comments" element={<UserComments />} />
            <Route path="/user/add" element={<AddStory />} />
            <Route path="/user/history" element={<GameHistory />} />
            <Route path="/user/settings" element={<UserSettings />} />
            <Route path="/subjects/:subject" element={<TopicsPage />} />
          </Routes>
        </BrowserRouter>
      </React.StrictMode>
    </div>
  );
}

export default App;
